    },
    {
      plan: 'Standard',
      price: 20,
      features: ['Feature 1', 'Feature 2', 'Feature 3', 'Feature 4'],
    },
    {
      plan: 'Premium',
      price: 30,
      features: ['Feature 1', 'Feature 2', 'Feature 3', 'Feature 4', 'Feature 5'],
    },
  ];

  return (
    <div id="services" className="card text-center">
      <div className='service-header'>
        <p className='card-header'>Pricing</p>
        <h3 className='card-header'>We've got a plan <br/>that's perfect for you</h3>
      </div>

      {/* Include the PricingCards component here */}
     <Services/>

      {/* Add the rest of your Services component content here */}
    </div>
  );
};
